import { MonitorDiv } from "./MonitorStyle"
import { Month } from "./MonitorStyle"
import { MonthYear } from "./MonitorStyle"
import { ButtonMonth } from "./MonitorStyle"
import { TodayButton } from "./MonitorStyle"

export function Monitor({today}) {
    console.log(today.format('LLLL'));
    console.log(today.locale('ru').format('LLLL'));
    console.log(today.format('LLLL'));
    return (
        <MonitorDiv>
            <div>
                <Month>{today.format('MMMM', 'ru')}</Month>
                <MonthYear>{today.format('YYYY').locale("ru")}</MonthYear>
            </div>
            <div>
                <ButtonMonth> &lt; </ButtonMonth>
                <TodayButton>Сегодня</TodayButton>
                <ButtonMonth> &gt; </ButtonMonth>
            </div>
        </MonitorDiv>
    )
}
